VALUES ('3302748138029', 'Nuggets de poisson riz et purée de brocolis - 270g', 'Riz cuit 29% (eau, riz), préparation à base de colin d\'Alaska panée 29% [_colin_ d\'Alaska, chapelure (farine de _blé_, levure, sel, paprika, curcuma), chair d\'_encornet_ géant, huile de tournesol, eau, amidon transformé de pommes de terre, farine de _blé_, sel, fumet de poisson (sel, protéine de _lait_, arôme, poudre de _poisson_, huile de tournesol, oignon, extrait de poivre, extrait de macis)], eau, brocolis 10%, flocons de pommes de terre   (pommes de terre déshydratées, extrait d\'épices ; émulsifiant : mono et diglycérides d\'acides gras), poudre de _lait_ écrémé, _crème_ fraîche, _beurre_, huile de colza, crème de riz, sel.', '', '4.9', '1.1', '22', '1.3', '1.5', '5.9', '0.83', '0.326771653543307', '', '1');

