INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3302749542023', 'PATES CONCHIGLIES AU SAUMON / SAUCE VINAIGRETTE / GRESSINS / COMPOTE DE FRUITS', 'Pâtes conchiglies au saumon 210g : pâtes conchiglies 57% (eau, semoule de _blé_ dur, curcuma), _saumon_ 28%, tomates, ciboulette, huile de colza, sel, eau. Sauce vinaigrette 30g : Huile de colza, eau, vinaigre de vin blan 20%, moutarde (eau, graines de _moutarde_, vinaigre, sel), sel, amidon modifié de pommes de terre, poivre. Mini biscuit salé à l\'huile d\'olive 20g : farine de _blé_, huile d\'olive vierge extra 7%, sel, levure, sucre, farine de malt d_\'orge_ ; agent de traitement de la farine : acide ascorbique Spécialité de fruits pêche abricot 90g : Pommes d\'Aquitaine 63%, pêches 18%, abricots 9%, sucres, acérola, concentré de citron. % exprimés sur chaque recette', 'https://static.openfoodfacts.org/images/products/330/274/954/2023/front_fr.3.400.jpg', '7.3', '0.9', '18', '4.7', '1.3', '5.9', '0.35', '0.137795275590551', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3302749543020', 'DUO DE  CREVETTES ET SURIMI / SAUCE VINAIGRETTE / GRESSINS / COMPOTE DE FRUITS', 'Duo de crevettes et miettes de surimi 230g : Pâtes perles 60% (eau, semoule de _blé_ dur, curcuma), préparation à base de chair de poisson 22% (chair de _poisson_, eau, amidon de _blé_ et fécule de pomme de terre, _lait_ écrémé réhydraté, huile de colza, sucre, sel, arômes (contient _crustacés_, _mollusques_, _poissons_), colorant : extrait de paprika), _crevettes_ 12%, huile de colza, persil, sel, coriandre, piment. Sauce vinaigrette 30g : Huile de colza, eau, vinaigre de vin blanc 20%, moutarde (eau, graines de _moutarde_, vinaigre, sel), sel, amidon modifié de pommes de terre, poivre. Mini biscuit salé à l\'huile d\'olive 20g : farine de _blé_, huile d\'olive vierge extra 7%, sel, levure, sucre, farine de malt d_\'orge_ ; agent de traitement de la farine : acide ascorbique Spécialité de fruits pommes poires 90g : pommes d\'Aquitaine 57%, poires 40%, acérola. % exprimés sur chaque recette', 'https://static.openfoodfacts.org/images/products/330/274/954/3020/front_fr.3.400.jpg', '6.6', '0.6', '19', '2.9', '0.7', '5.2', '0.86', '0.338582677165354', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3302749544027', 'POULET AUX SAVEURS MAROCAINES / GRESSINS / COMPOTE DE FRUITS', 'Poulet aux saveurs marocaines 250g : Légumes (aubergines 21%, courgettes 25%, tomates 12%), poulet traité en salaison (poulet 21%, amidon de tapioca, dextrose, sel), huile de tournesol, concentré de tomates, huile d\'olive vierge, bouillon (eau, os de poulet, os de veau, vin blanc, concentré de tomate, sel, huile de colza, carotte, oignon, _céleri_, plantes aromatiques), zeste de citron, huile de colza, plantes aromatiques, ail, sel, épices, eau, vinaigre d\'alcool, sucre, oignons. Mini biscuit salé à l\'huile d\'olive 20g : farine de _blé_, huile d\'olive vierge extra 7%, sel, levure, sucre, farine de malt d_\'orge_ ; agent de traitement de la farine : acide ascorbique Spécialité pommes 90g : pommes d\'Aquitaine 97%, acérola. % exprimés sur chaque recette', 'https://static.openfoodfacts.org/images/products/330/274/954/4027/front_fr.3.400.jpg', '6.3', '0.7', '13', '6.1', '1.8', '5.9', '0.62', '0.244094488188976', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3302749545024', 'RISOTTO POULET AUX HERBES / GRESSINS / COMPOTE DE FRUITS', 'Riz 25% (eau, riz, curcuma), poulet traité en salaison (poulet 21%, amidon de tapioca, dextrose, sel), eau, courgettes, _crème_ fraîche, tomates,  bouillon (eau, os de poulet, oignon, poireau, _céleri_, carotte, sel),  crème de riz, oignons, huile de colza, _parmesan_, _fromage_ à pâte dure, farine de _blé_, vin blanc, basilic 0.5%, _beurre_, sel, persil, épices, huile d\'olive vierge. Mini biscuit salé à l\'huile d\'olive 20g : farine de _blé_, huile d\'olive vierge extra 7%, sel, levure, sucre, farine de malt d_\'orge_ ; agent de traitement de la farine : acide ascorbique Spécialité de fruits pommes framboises 90g : pommes d\'Aquitaine 70%, framboise 18%, banane, acérola. % exprimés sur chaque recette', '', '4.4', '1.9', '17', '4', '0.9', '6.5', '0.56', '0.220472440944882', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3302749547028', 'FALAFELS MELI MELO DE BOULGOUR ET QUINOA / SAUCE VINAIGRETTE / GRESSINS / COMPOTE DE FRUITS', 'Falafels et méli mélo de boulgour et quinoa 240g : boulgour 29% (eau, _blé_ dur), falafels 25% [pois chiches, protéines végétales réhydratées [bouillon (eau, sel, oignon, poireau, _céleri_, carotte), protéines de pois], fèves, oignon, huile d\'olive vierge, huile de colza, protéines de pois, coriandre, fécule de manioc, menthe, sel, ail, huile de tournesol, épices, plantes aromatiques], quinoa rouge 13% (eau, quinoa, sel), pois chiche, tomates semi-déshydratées, huile d\'olive vierge, citron, coriandre, sel, persil, poivre. Sauce vinaigrette 20g : Huile de colza, eau, vinaigre de vin blanc 20%, moutarde (eau, graine de _moutarde_, vinaigre, sel), sel, amidon modifié de pommes de terre, poivre. Mini biscuit salé à l\'huile d\'olive 20g : farine de _blé_, huile d\'olive vierge extra 7%, sel, levure, sucre, farine de malt d_\'orge_ ; agent de traitement de la farine : acide ascorbique Spécialité de fruits pomme fraise myrtille 90g : Pommes d\'Aquitaine 69%, fraises 20%, sucres, jus de myrtilles, acérola, concentré de citron. % exprimés sur chaque recette', 'https://static.openfoodfacts.org/images/products/330/274/954/7028/front_fr.3.400.jpg', '7.1', '1', '20', '4.7', '3.3', '4', '0.96', '0.377952755905512', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
