INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3302749611026', 'Pavé de Légumes au Chèvre et Purée de Courgettes', 'Courgettes 42%, spécialité à base de protéines végétales, légumes et fromage de chèvre 26% [protéines végétales réhydratées [bouillon (eau, sel, oignons, poireaux, _céleri_, carottes), protéines de _soja_, protéines de pois, farine de _soja_, amidon de tapioca], poivrons déshydratés 2.6%, _fromage_ de chèvre 2.4%, préparation à base de tomates (tomates, huile de tournesol, sucre, sel, oignons, ail), courgettes 1%, oignons, huile de colza, aubergines 0.8%, fécule de manioc, poudre de blanc d\'_oeufs_, flocons de pommes de terre, protéines de _soja_, sel, huile de tournesol, ail, épices, plantes aromatiques], flocons de pommes de terre, eau, _crème_ fraîche 5.7%, crème de riz, _beurre_ 1.8%, poudre de _lait_ écrémé, _emmental_, chapelure 1.2% (dont _blé_), amidon de riz, poivrons rouges 0.7%, huile de colza, sel, épices.', 'https://static.openfoodfacts.org/images/products/330/274/961/1026/front_fr.44.400.jpg', '6.6', '3.1', '14', '3.3', '2.5', '6.1', '0.79', '0.311023622047244', '', '1');

