VALUES ('3302749665029', 'SALAD JAR - La Parisienne - Jambon, farfalles, emmental, oeufs, carottes râpées, sauce vinaigrette', 'Pâtes mini farfalle 34% (eau, semoule de _blé_ dur, curcuma), carotte 26%, oeufs 10% (_oeufs_, acidifiants : acide citrique - acide acétique), salade 10%, jambon cuit de Paris choix 8% [jambon de porc, acidifiant : lactate de potassium, dextrose de maïs, sel, bouillon (eau, épices, plantes aromatiques), antioxydant : ascorbate de sodium, conservateur : nitrite de sodium], _emmental_ 8%, huile de colza, sel. (% exprimés sur la salade). Sauce vinaigrette 30g : Eau, huile de colza, _crème_ fraîche, vinaigre de vin rouge, moutarde (eau, graines de _moutarde_, vinaigre, sel), moutarde à l\'ancienne (eau, graines de _moutarde_, vinaigre, sel), poudre de _lait_ écrémé, amidon de riz, sel, poivre.', 'https://static.openfoodfacts.org/images/products/330/274/966/5029/front_fr.40.400.jpg', '8.5', '2.3', '14', '1.8', '1.4', '6.9', '0.84', '0.330708661417323', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3302749666026', 'SALAD JAR - La Caesar - Poulet, pâtes radiatori, oeufs, tomates, sauce Caesar', 'Pâtes radiatori 55% (eau, semoule de _blé_ dur, curcuma), oeufs 10% (_oeufs_, acidifiants : acide citrique - acide acétique), spécialité de volaille cuite - traitée en salaison et rôtie 10% [aiguillette de poulet 8%, bouillons (eau, os de poulet, sel, épices, ail), acidifiant : lactate de potassium, sel, dextrose de maïs, fécule de manioc], salade 10%, tomate cerise 8%, _fromage_ pâte dure, huile de colza, sel. (% exprimés sur la salade). Sauce caesar 30g : Eau, huile de colza, vinaigre de vin blanc, _crème_ fraîche, _parmesan_ 5%, poudre de _lait_ écrémé, sucre, sel, ail, amidon de riz, moutarde (eau, graines de _moutarde_, vinaigre, sel). (% exprimés sur la sauce).', 'https://static.openfoodfacts.org/images/products/330/274/966/6026/front_fr.39.400.jpg', '7.1', '1.7', '15', '1.3', '0.9', '7.8', '0.79', '0.311023622047244', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3302749667023', 'SALAD JAR - L\'Orientale - Falafels, semoule, courgettes, carottes, raisins secs, sauce épice douce', 'Courgette 18%, carotte 18%, semoule réhydratée 16% (eau, semoule de _blé_ dur), eau, boulettes végétales à base de pois chiche 12% [pois chiches 5.5%, protéines végétales réhydratées [bouillon (eau, sel, oignon, poireau, _céleri_, carotte), protéines de pois], fèves 0.8%, oignon, huile d\'olive vierge, huile de colza, protéines de pois, coriandre, fécule de manioc, menthe, sel, ail, huile de tournesol, épices, plantes aromatiques], salade 10%, raisins 3.7%, huile de colza, huile d\'olive vierge, sel, citron, épices. (% exprimés sur la salade). Sauce orientale 30g : Eau, huile de colza, jus concentré d\'orange, huile d\'olive vierge extra, vinaigre, zeste de citron jaune, jus concentré de citron jaune, amidon de riz, sel, coriandre, persil, sucre, cumin 0.2%. (% exprimés sur la sauce).', 'https://static.openfoodfacts.org/images/products/330/274/966/7023/front_fr.22.400.jpg', '8', '0.8', '17', '4.2', '2.2', '3.8', '0.92', '0.362204724409449', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3302749669027', 'SALAD JAR - La Nicoise - Thon, pommes de terre, oeufs, maïs, olives, sauce vinaigrette', 'Pommes de terre 42% (pommes de terre, curcuma), salade 12%, oeufs 10% (_oeufs_, acidifiants : acide citrique - acide acétique), olives noires 9.8%, _thon_ listao 9.8%, tomate cerise 8%, maïs, huile d\'olive vierge, sel, eau. (% exprimés sur la salade). Sauce vinaigrette 30g : Huile de colza, eau, vinaigre de vin blanc, moutarde (eau, graines de _moutarde_, vinaigre, sel), sel, amidon modifié de pommes de terre, poivre.', 'https://static.openfoodfacts.org/images/products/330/274/966/9027/front_fr.26.400.jpg', '7.9', '1', '8.8', '1.1', '1.7', '5', '0.66', '0.259842519685039', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3302749671020', 'SALAD JAR - La Californienne - Boulgour quinoa, graines de courge, pois chiches, légumes, sauce blanche', 'Boulgour quinoa 36% (eau, _blé_ dur, quinoa,), tomate 14% (tomate, jus de tomate, acidifiant : acide citrique), salade 10%, courgette 7.6%, poivron rouge 7%, pois chiche 7%, huile de colza, cranberries 3% (cranberries, sucre de canne, huile de tournesol), graines de courge 3%, poivron jaune 2.7%, huile d\'olive vierge, huile de tournesol, oignon, sel, vinaigre de vin rouge, coriandre, sucre, piment de Cayenne. (% exprimés sur la salade). Sauce blanche 30g : Eau, _fromage_, huile de colza, vinaigre d\'alcool, ciboulette, sel, amidon modifié de pommes de terre, jus concentré de citron jaune, poivre.', 'https://static.openfoodfacts.org/images/products/330/274/967/1020/front_fr.21.400.jpg', '8.5', '1', '14', '3.5', '2.1', '4', '0.9', '0.354330708661417', '', '1');

