INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3302749776022', 'PATES CONCHIGLIES AU SAUMON / SAUCE VINAIGRETTE / COMPOTE DE FRUITS', '_Pâtes conchiglies au saumon 210g_ : Pâtes conchiglies 57% (eau, semoule de _blé_ dur, curcuma), _saumon_ 28%, tomates, ciboulette, huile de colza, sel, eau. _Sauce vinaigrette 30g_ : Huile de colza, eau, vinaigre de vin blanc 20%, moutarde (eau, graines de _moutarde_, vinaigre, sel), sel, amidon modifié de pommes de terre, poivre. _Spécialité de fruits pêche abricot 90g_ : Pommes 64%, pêches 19%, abricots 9.5%, sirop de sucres, acérola, concentré de citron. % exprimés sur chaque recette', 'https://static.openfoodfacts.org/images/products/330/274/977/6022/front_fr.9.400.jpg', '7.3', '0.9', '15', '4.8', '1.2', '5.6', '0.29', '0.114173228346457', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3302749777029', 'DUO DE  CREVETTES ET SURIMI / SAUCE VINAIGRETTE / COMPOTE DE FRUITS', '_Duo de crevettes et miettes de surimi 230g_ : Pâtes perles 60% (eau, semoule de _blé_ dur, curcuma), préparation à base de chair de poisson 22% (chair de _poisson_, eau, amidon de _blé_ et fécule de pomme de terre, _lait_ écrémé réhydraté, huile de colza, sucre, sel, arômes (contient _crustacés_, _mollusques_, _poissons_), colorant : extrait de paprika), _crevettes_ 12%, huile de colza, persil, sel, coriandre, piment. _Sauce vinaigrette 30g_ : Huile de colza, eau, vinaigre de vin blanc 20%, moutarde (eau, graines de _moutarde_, vinaigre, sel), sel, amidon modifié de pommes de terre, poivre. _Spécialité de fruits pommes poires 90g_ : pommes 57%, poires 40%, acérola. % exprimés sur chaque recette.', 'https://static.openfoodfacts.org/images/products/330/274/977/7029/front_fr.7.400.jpg', '6.5', '0.5', '16', '2.9', '0.6', '4.9', '0.84', '0.330708661417323', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3302749778026', 'POULET AUX SAVEURS MAROCAINES / COMPOTE DE FRUITS', '_Poulet aux saveurs marocaines 250g_ : Aubergines préfrites 25% (aubergines, huile de tournesol), courgettes 25%, poulet traité en salaison (poulet 21%, amidon de tapioca, dextrose, sel), tomates 10%, concentré de tomates, bouillons (eau, os de poulet, os de veau, vin blanc, concentré de tomate, sel, huile de colza, carotte, oignon, _céleri_, plantes aromatiques), huile d\'olive vierge, préparation à base de tomates 2.4% (tomates, huile de tournesol, sucre, sel, oignons, ail), zeste de citron, huile de colza, ail, coriandre, sel, paprika, eau, vinaigre d\'alcool, thym, cumin. _Spécialité pommes 90g_ : pommes 97%, acérola. % exprimés sur chaque recette.', 'https://static.openfoodfacts.org/images/products/330/274/977/8026/front_fr.9.400.jpg', '6.2', '0.6', '9.2', '6.2', '1.7', '5.6', '0.58', '0.228346456692913', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3302749780029', 'RISOTTO POULET AUX HERBES / COMPOTE DE FRUITS', '_Risotto poulet aux herbes 260g_ : Riz 25% (eau, riz, curcuma), poulet traité en salaison (poulet 21%, amidon de tapioca, dextrose, sel), eau, courgettes, _crème_ fraîche, tomates, bouillons (eau, os de poulet, oignon, poireau, _céleri_, carotte, sel),  crème de riz, oignons frits (oignon, huile d\'olive vierge, sel), huile de colza, _parmesan_, _fromage_ à pâte dure, farine de _blé_, vin blanc, basilic 0.5%, _beurre_, sel, persil, paprika, curcuma, poivre. _Spécialité de fruits pommes framboises 90g_ : pommes 70%, framboise 18%, banane, acérola. % exprimés sur chaque recette.', 'https://static.openfoodfacts.org/images/products/330/274/978/0029/front_fr.9.400.jpg', '4.2', '1.9', '14', '4', '0.8', '6.2', '0.52', '0.204724409448819', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3302749781026', 'FALAFELS MELI MELO DE BOULGOUR ET QUINOA / SAUCE VINAIGRETTE / COMPOTE DE FRUITS', '_Falafels et méli mélo de boulgour et quinoa 240g_ : boulgour 29% (eau, _blé_ dur,sel), falafels 25% [pois chiches, protéines végétales réhydratées [bouillon (eau, sel, oignon, poireau, _céleri_, carotte), protéines de pois], fèves, oignon, huile d\'olive vierge, huile de colza, protéines de pois, coriandre, fécule de manioc, menthe, sel, ail, huile de tournesol, épices, plantes aromatiques], quinoa rouge 13% (eau, quinoa, sel), pois chiche, tomates semi-déshydratées, huile d\'olive vierge, citron, coriandre, sel, persil, poivre. _Sauce vinaigrette 30g_ : Huile de colza, eau, vinaigre de vin blanc 20%, moutarde (eau, graines de _moutarde_, vinaigre, sel), sel, amidon modifié de pommes de terre, poivre. _Spécialité de fruits pomme fraise myrtille 90g_ : Pommes 69%, fraises 21%, sirop de sucres, jus de myrtilles, acérola, concentré de citron. % exprimés sur chaque recette.', 'https://static.openfoodfacts.org/images/products/330/274/978/1026/front_fr.9.400.jpg', '8.5', '1', '18', '5.2', '3', '4.6', '0.92', '0.362204724409449', '', '1');

