VALUES ('3302749783020', 'FETA SEMOULE ORIENTALE / SAUCE VINAIGRETTE / COMPOTE DE FRUITS', '_Feta, semoule orientale 240g_ : Semoule 42% (eau, semoule de _blé_ dur), feta 25% (_lait_ frais de brebis et de chèvre, sel, présure, ferments lactiques), tomates 8.6%, eau, carottes, huile de colza, oignons frits (oignon, huile d\'olive vierge, sel), citron 2%, jus d\'orange 1.3%, ciboulette, sel, menthe, amidon transformé de riz, persil, coriandre, poivre. _Sauce vinaigrette 30g_ : Huile de colza, eau, vinaigre de vin blanc 20%, moutarde (eau, graines de _moutarde_, vinaigre, sel), sel, amidon modifié de pommes de terre, poivre. _Spécialité de fruits pomme mangue ananas 90g_ : Pommes 40%, mangues 35%, jus d\'ananas 22%, acérola. % exprimés sur chaque recette.', 'https://static.openfoodfacts.org/images/products/330/274/978/3020/front_fr.7.400.jpg', '8.7', '2.8', '15', '3.9', '1.2', '4.9', '0.89', '0.350393700787402', '', '1');

