INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3302749799021', 'Cabillaud, crème d\'écrevisses, riz au pavot', 'Riz 38% (eau, riz), cabillaud (_cabillaud_ 31%, eau, huile de colza, sel, gélatine de _poisson_, piment d\'Espelette), jus de cuisson, _crème_ fraiche 8,7%, fumet de crabe (eau, _crabe_, vin blanc, Cognac, sel, huile de colza, carottes, oignons, _céleri_, thym, laurier, badiane), _écrevisses_ de Louisiane 1,2%, concentré de tomates, huile de colza, sel, amidon de riz, Cognac 0,2% , graines de pavot bleu 0,1%, gélatine de _poisson_, colorant: extrait de paprika, poivre, piment.', 'https://static.openfoodfacts.org/images/products/330/274/979/9021/front_fr.4.400.jpg', '4.3', '1.7', '12', '0.5', '0.5', '8.6', '0.76', '0.299212598425197', '', '1');

