VALUES ('3302794249106', 'Poulet et risotto aux cepes', 'Eau, riz long cuit 25% (eau, riz), crème fraîche, poulet traité en salaison (po let 13%, amidon de tapioca, dextrose, sel), champignons 2.6% (champignons de Paris, sel), cèpes (2.6%), vin blanc, oignons, arôme naturel (blé, lait), huile de colza, amidon transformé de riz, farine de blé, ciboulette (0.3%), beurre, sel, poivre. Poulet origine Pologne. Malgré tout le soin que nous avons apporté à l\'élaboration de ce plat, vous pouvez trouver exceptionnellement quelques morceaux d\'os. r Les informations en gras sont destinées aux allergiques et intolérants. Poids net : Une allergie, une intolérance, retrouvez notre moteur de recherche 280 ge I allergènes sur notre site www.fleurymichon.fr', 'https://static.openfoodfacts.org/images/products/330/279/424/9106/front_fr.4.400.jpg', '20', '11', '34', '2.8', '3.9', '15', '2.2', '0.866141732283465', '', '0');

